import React, { useState } from "react";

function Filter() {
  const [search, setSearch] = useState("");
  function changed(e) {
    const userInput = e.target.value;
    setSearch(userInput);
  }
  return (
    <div>
      <input
        type="text"
        onChange={changed}
        value={search}
        placeholder="enter contact name"
        name=""
        id=""
      />
      <button>Check</button>
    </div>
  );
}

export default Filter;
